import React from "react";
import PageBorder from "../../components/PageBorder";

function Review() {
  return (
    <PageBorder>
      <div className="space-y-4 text-gray-700">
        <h1 className="text-4xl leading-none">
          Harry Potter and the Sorcerer's Stone
        </h1>
        <hr />
        <h2 className="px-2 py-1 text-2xl leading-none bg-gray-100">TL;DR</h2>
        <p>
          This is the first book in J.K. Rowling's famous Harry Potter series. I
          read it because I'm trying to make reading a more consistent habit in
          my life and one suggestion for doing that is to read what you enjoy
          until you enjoy reading. The books is well written by YA standards and
          was a real page turner. It accomplished my goal of getting me excited
          about reading again.
        </p>
      </div>
    </PageBorder>
  );
}

export default Review;
